import React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import AdbIcon from '@mui/icons-material/Adb';

const pages = ['Home', 'Upload & Analysis', 'Feedback'];

const HomePage = () => {
  return (
    <>
      <AppBar
        position='static'
        style={{ background: 'linear-gradient(to right, #311b92, #000000)' }}
      >
        <Container maxWidth='xl'>
          <Box
            sx={{
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'space-between',
              py: 1,
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <AdbIcon sx={{ color: 'white', mr: 1 }} />
              <Typography
                variant='h6'
                noWrap
                component='a'
                href='#app-bar-with-responsive-menu'
                sx={{
                  fontFamily: 'monospace',
                  fontWeight: 700,
                  letterSpacing: '.3rem',
                  color: 'white',
                  textDecoration: 'none',
                }}
              >
                Design Boost
              </Typography>
            </Box>

            <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
              {pages.map((page) => (
                <Typography
                  key={page}
                  variant='body1'
                  sx={{ mx: 2, color: 'white', cursor: 'pointer' }}
                >
                  {page}
                </Typography>
              ))}
              <Typography
                variant='body1'
                sx={{ mx: 2, color: 'white', cursor: 'pointer' }}
              >
                Sign In
              </Typography>
              <Typography variant='body1' sx={{ mx: 2 }}>
                <Box
                  component='span'
                  sx={{
                    color: 'white',
                    backgroundColor: '#6200ea',
                    px: 1,
                    borderRadius: '5px',
                  }}
                >
                  Sign Up
                </Box>
              </Typography>
            </Box>
          </Box>
        </Container>
      </AppBar>

      <Container
        sx={{ position: 'relative', overflow: 'hidden', marginTop: '-20px' }}
      >
        <Box
          sx={{
            position: 'absolute',
            bottom: 0,
            left: 0,
            width: '100%',
            height: '50px',
            background: 'linear-gradient(to bottom, #311b92, #000000)',
            clipPath: 'ellipse(100% 50% at 0% 0%)',
          }}
        />

        <Box
          sx={{
            position: 'absolute',
            top: '50%',
            left: '5%',
            transform: 'translateY(-50%)',
            textAlign: 'left',
            width: '40%',
            color: 'white',
          }}
        >
          <Typography variant='h3' fontWeight={700} fontFamily='monospace'>
            Elevate Your Designs with Design Boost
          </Typography>
          <Typography variant='subtitle1' mt={2}>
            Unleash the power of stunning and user-friendly interfaces.
          </Typography>
        </Box>
      </Container>
    </>
  );
};

export default HomePage;
